@pytest.mark.smoke
def test_successful_image_upload(mock_s3_client):
    event = {
        'headers': {
            'Content-Type': 'image/jpeg',
            'file_name': 'random.jpg'
        },
        'body': '',  # Base64 for a 1x1 PNG image
        'isBase64Encoded': True
    }
    context = {}
    response = lambda_handler(event, context)

    assert response['statusCode'] == 200
    body = json.loads(response['body'])
    assert body['message'] == 'Image uploaded successfully'
    assert 'file_name' in body
    assert response['body'] is not None


def test_upload_failure(mock_s3_client):
    event = {
        'headers': {
            'Content-Type': 'image/jpeg'
        },
        'body': 'iVBORw0KGgoAAAANSUhEUgAAAAUAAAAFCAYAAACNbyblAAAAHElEQVQI12P4//8/w38GIAXDIBKE0DHxYAAAABJRU5ErkJggg==',
        'isBase64Encoded': True
    }
    context = {}
    response = lambda_handler(event, context)

    assert response['statusCode'] == 500
    body = json.loads(response['body'])
    assert body['message'] == 'Internal Server Error'
    assert 'error' in body